    public int[][] updateMatrix(int[][] mat)
    {
        int row = mat.length;
        int col = mat[0].length;
        Queue<cell> q = new LinkedList<>();
        for (int r = 0; r < row; r++)
        {
            for (int c = 0; c < col; c++)
            {
                if (mat[r][c] == 0) q.offer(new cell(r, c));
                else mat[r][c] = 200000;
            }
        }
        while (!q.isEmpty())
        {
            cell tmp = q.poll();
            int tr = tmp.rowC;
            int tc = tmp.columnC;
            int val = mat[tr][tc];
            for (int i = 0; i < 4; i++)
            {
                int nr = tr + dr[i];
                int nc = tc + dc[i];
                if (nr < 0 || nc < 0 || nr >= row || nc >= col || mat[nr][nc] == 0) continue;
                if (mat[tr][tc] + 1 < mat[nr][nc])
                {
                    mat[nr][nc] = mat[tr][tc] + 1;
                    q.offer(new cell(nr, nc));
                }
            }
        }
        return mat;
    }

